import { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';
import { Stack } from '@mui/material';
import PokemonList from './components/PokemonList';
import PokemonAdd from './components/PokemonAdd'

function App() {
  const [pokemon, setPokemon] = useState([]);

  const fetchPokemon =  async () => {
    try {
      axios.get('http://localhost:5000/api/v1/pokemon/').then(res => {
        setPokemon(res.data);
      }).catch(err => {
        console.log(err);
      });
    }catch(err) {
      console.log(err);
    }
  };

  const addPokemon = () => {
    try {
      axios.post('http://localhost:5000/api/v1/pokemon/').then(res => {
        console.log(res);
      })
    }catch (err){
      console.log(err);
    }
  }

  useEffect(() => {
    fetchPokemon();
  }, []);


  return (
    <Stack>
      <PokemonList
      data={pokemon}/>
      <PokemonAdd
      onClick={addPokemon}/>
    </Stack>
  );
}

export default App;
